import React from "react";

const Category = () => {
  return (
    <React.Fragment>
      <Sns
        onClick={() => {
          history.push("/post");
        }}
      >
        SNS
      </Sns>
      <Board
        onClick={() => {
          history.push("/board");
        }}
      >
        게시판
      </Board>
    </React.Fragment>
  );
};

export default Category;
